            var val = obj.val();
            var filename = obj.val().replace(/C:\\fakepath\\/i, '');
            var filesize = obj[0].files[0].size;

            switch (val.substring(val.lastIndexOf('.') + 1).toLowerCase()) {
                case 'jpg':
